	return(
		<div className="container py-3 input-group flex-nowrap">
			<div className="form-group">
			   
			    <select className="form-control" 
			    	>
			      {
			      	options.map((option,index) => (
			      		<option value={option.value} key={index}>
			      			{option.value}
			      		</option>
			      	))
			      }
			    </select>
			  	</div>
		</div>
	)
}

